// import logo from './logo.svg';
import './App.css';
import { Container } from 'react-dom';


function Welcome(props) {
  return <h1>Hello, {props.name}</h1>;
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Welcome name="User"/>
      <p>Enter the name of the product</p>
      </header>
    </div>
  );
}

export default App;
